setup.javascript:
this.w_type = this.settings.kvwidget;
this.w_input = this.settings;

delete this.w_input['kvwidget'];
delete this.w_input['label'];

children.javascript:
var state = {
    "body": {}
};

state["body"]["key"] = {
    type: 'textbox',
    settings: {
      	width: 50,
        data: (this.settings.data ? this.settings.data.key : undefined)
    }
};

state["body"]["value"] = {
    type: this.w_type,
    settings: deep.clone(this.w_input),
};
state["body"]["value"]["settings"]["data"] = this.settings.data ? this.settings.data.value : undefined;

state["body"]["delete"] = {
    type: "row_delete",
};

callback(state);

processData.javascript:
var key = data.key;
var widget = cms.functions.newWidget(this.w_type, this.settings);

var out = {};
out['key'] = key;
out['value'] = widget.processData(data.value);
console.log(out);

return out;

